import React from 'react';
import { Routes, Route } from 'react-router-dom';
import { AuthProvider } from './context/AuthContext';

/* ------- σελίδες ------- */
import Home from './pages/Home';
import Profile from './pages/Profile';
import MyBookings from './pages/MyBookings';
import NotFound from './pages/NotFound';
import Articles from './pages/Articles';
import Sitters from './pages/Sitters';
import Booking from './pages/Booking';
import Contact from './pages/Contact';
import Areas from './pages/Areas';
import AreaSitters from './pages/AreaSitters';

/* ------- components ------- */
import Login from './components/auth/Login.jsx';
import Register from './components/auth/Register.jsx';
import ForgotPassword from './components/auth/ForgotPassword.jsx';
import Header from './components/common/Header';
import Footer from './components/common/Footer';

function App() {
  return (
    <AuthProvider>
    <div className="fixed inset-0 z-0 pointer-events-none overflow-hidden">
      {/* 1️⃣ Κόκκινα – καρδιές & κολάρα */}
      <span className="shape top-[5%] left-[5%] scale-110" style={{ animationDelay: '0s', rotate: '-15deg' }}>
        <svg width="36" height="36" viewBox="0 0 24 24" fill="#ef4444"><path d="M12 21.35l-1.45-1.32C5.4 15.36 2 12.28 2 8.5 2 5.42 4.42 3 7.5 3c1.74 0 3.41.81 4.5 2.09C13.09 3.81 14.76 3 16.5 3 19.58 3 22 5.42 22 8.5c0 3.78-3.4 6.86-8.55 11.54L12 21.35z"/></svg>
      </span>
      <span className="shape top-[12%] right-[8%] scale-90" style={{ animationDelay: '3s', rotate: '20deg' }}>
        <svg width="32" height="32" viewBox="0 0 24 24" fill="none" stroke="#ef4444" strokeWidth="3"><path d="M18 8h1a4 4 0 0 1 0 8h-1M4 8h1a4 4 0 0 1 0 8H4m7-8v8"/></svg>
      </span>

      {/* 2️⃣ Πορτοκαλί – σπιτάκια / ταΐστρες */}
      <span className="shape top-[85%] left-[10%] scale-125" style={{ animationDelay: '5s', rotate: '10deg' }}>
        <svg width="40" height="40" viewBox="0 0 24 24" fill="#f97316"><path d="M3 9l9-7 9 7v11a2 2 0 0 1-2 2H5a2 2 0 0 1-2-2z"/><polyline points="9 22 9 12 15 12 15 22"/></svg>
      </span>
      <span className="shape top-[90%] right-[15%] scale-75" style={{ animationDelay: '8s', rotate: '-25deg' }}>
        <svg width="28" height="28" viewBox="0 0 24 24" fill="none" stroke="#f97316" strokeWidth="3"><circle cx="12" cy="12" r="10"/><path d="M12 7v5l3 3"/></svg>
      </span>

      {/* 3️⃣ Κίτρινα – παιχνίδια / μπάλες */}
      <span className="shape top-[50%] left-[2%] scale-150" style={{ animationDelay: '2s', rotate: '60deg' }}>
        <svg width="44" height="44" viewBox="0 0 24 24" fill="#facc15"><circle cx="12" cy="12" r="10"/><path d="M12 2a15.3 15.3 0 0 1 4 10 15.3 15.3 0 0 1-4 10 15.3 15.3 0 0 1-4-10 15.3 15.3 0 0 1 4-10z"/></svg>
      </span>
      <span className="shape top-[60%] right-[5%] scale-100" style={{ animationDelay: '11s', rotate: '-40deg' }}>
        <svg width="32" height="32" viewBox="0 0 24 24" fill="#facc15"><path d="M18 8h1a4 4 0 0 1 0 8h-1M4 8h1a4 4 0 0 1 0 8H4m7-8v8"/></svg>
      </span>

      {/* 4️⃣ Πράσινα – κόκκαλα / βούρτσες */}
      <span className="shape top-[20%] left-[80%] scale-110" style={{ animationDelay: '7s', rotate: '45deg' }}>
        <svg width="36" height="36" viewBox="0 0 24 24" fill="#22c55e"><path d="M15 12c0 2.2-1.8 4-4 4s-4-1.8-4-4 1.8-4 4-4 4 1.8 4 4z"/><path d="M12 2v4m0 12v4m-6-10h4m8 0h4"/></svg>
      </span>
      <span className="shape top-[70%] left-[50%] scale-80" style={{ animationDelay: '14s', rotate: '-10deg' }}>
        <svg width="30" height="30" viewBox="0 0 24 24" fill="none" stroke="#22c55e" strokeWidth="3"><path d="M4 13.5c0-2 1.5-4.5 3-4.5s3 2.5 3 4.5v1c0 2-1.5 4.5-3 4.5s-3-2.5-3-4.5v-1z"/><path d="M20 13.5c0-2-1.5-4.5-3-4.5s-3 2.5-3 4.5v1c0 2 1.5 4.5 3 4.5s3-2.5 3-4.5v-1z"/><path d="M12 3c-2 0-4 1-4 3v1c0 2 2 3 4 3s4-1 4-3V6c0-2-2-3-4-3z"/><path d="M12 14v6"/></svg>
